/* Put important imports below this comment */ 
import { Route, Routes } from "react-router-dom";

/* Put features imports below this comment */ 
import Navbar from "./components/features/Navbar.jsx";
import Footer from "./components/features/Footer.js"; 

/* Put page imports below this comment */ 
import DashboardPage from "./components/main-pages/Dashboard.jsx";
import LeadsPage from "./components/main-pages/Leads.jsx";
import BorrowersPage from "./components/main-pages/Borrowers.jsx";
import LendersPage from "./components/main-pages/Lenders.jsx";
import ResourcesPage from "./components/main-pages/Resources.jsx";



function App() {
  return (
  <>
    <div>
    <Navbar />
    <div className="nav-header">
    <Routes>
      <Route path="/dashboard" element={<DashboardPage />} />
      <Route path="/dashboard" element={<DashboardPage />} />
      <Route path="/leads" element={<LeadsPage />} />
      <Route path="/borrowers" element={<BorrowersPage />} />
      <Route path="/lenders" element={<LendersPage />} />
      <Route path="/resources" element={<ResourcesPage />} />
    </Routes>
    </div>
    <Footer /> 
    </div>
  </>
  )
  }

export default App;
